# Función para encontrar duplicados en el DF
def find_duplicates_rows(df: pd.DataFrame) -> pd.DataFrame:
    """
    Busca duplicados en el marco de datos
    
    Args:
        df: pandas.DataFrame
        
    Devuelve: pandas.DataFrame
    """
    # Crea un nuevo DataFrame booleano donde True indica que la fila está duplicada
    df_duplicados = df.duplicated(keep=False)
    # Filtra el DataFrame original para solo obtener las filas duplicadas
    df_filas_duplicadas = df[df_duplicados]
    # Devuelve el DataFrame de filas duplicadas
    if df_filas_duplicadas.empty:
        return None
    return df_filas_duplicadas

# Función para encontrar filas nulas en el DF
def find_null_rows(df: pd.DataFrame) -> pd.DataFrame:
    """
    Searches for nulls in the dataframe
    
    Args:
        df: pandas.DataFrame
        
    Returns: pandas.DataFrame
    """
    # Crea un nuevo DataFrame booleano donde True indica que la fila tiene valores nulos
    df_nulos = df.isnull().any(axis=1)
    # Filtra el DataFrame original para solo obtener las filas con valores nulos
    df_filas_nulas = df[df_nulos]
    # Devuelve el DataFrame de filas con valores nulos
    if df_filas_nulas.empty:
        return None
    return df_filas_nulas

# Función para encontrar columnas nulas en el DF
def find_null_columns(df: pd.DataFrame) -> pd.DataFrame:
    """
    Busca nulos en las columnas del marco de datos
    
    Args:
        df: pandas.DataFrame
        
    Returns: pandas.DataFrame
    """
    # Crea una Serie booleana donde True indica que la columna tiene valores nulos
    columnas_nulas = df.isnull().any(axis=0)
    
    # Filtra el DataFrame original para solo obtener las columnas con valores nulos
    df_columnas_nulas = df.loc[:, columnas_nulas]
    
    # Devuelve el DataFrame de columnas con valores nulos
    if df_columnas_nulas.empty:
        return None
    return df_columnas_nulas

# Función para eliminar columnas innecesarias
def drop_unnecessary_columns(df:pd.DataFrame, cols_to_drop:list) -> pd.DataFrame:
    """
    Elimina columnas innecesarias del DataFrame.
    
    Args:
        df: DataFrame original.
        cols_to_drop: Lista de nombres de columnas a eliminar.
        
    Returns: 
        DataFrame con las columnas eliminadas.
    """
    df = df.drop(columns=cols_to_drop)
    return df

# Función para renombrar los encabezados de las columnas
def rename_columns(df:pd.DataFrame, cols_to_rename:dict) -> pd.DataFrame:
    """
    Renombra las columnas del DataFrame.
    
    Args:
        df: DataFrame original.
        cols_to_rename: Diccionario con los nombres de columnas a renombrar.
        
    Returns: 
        DataFrame con las columnas renombradas.
    """
    df = df.rename(columns=cols_to_rename)
    return df

# Función para modificar (formatear) las columnas fecha y hora
# y asignarles el formato de la columna a un objeto datetime
def parse_date_time_columns(df: pd.DataFrame) -> pd.DataFrame:
    """
    Realiza el formateo de las columnas de fecha y hora.
    
    Args:
        df: DataFrame original.
        
    Returns: 
        DataFrame con las columnas de fecha y hora formateadas.
    """
    # Reemplaza 'p. m.' y 'a. m.' con 'PM' y 'AM' respectivamente en la columna 'hora'
    df['hora'] = df['hora'].str.replace('p.\xa0m.', 'PM', regex=False)
    df['hora'] = df['hora'].str.replace('a.\xa0m.', 'AM', regex=False)
    # Convierte la columna 'hora' a un objeto datetime.time
    df['hora'] = pd.to_datetime(df['hora'], format='%I:%M:%S %p').dt.time
    # Convierte la columna 'fecha' a un objeto datetime.date
    df['fecha'] = pd.to_datetime(df['fecha'], format='%d/%m/%Y').dt.date
    # Unir fecha y hora
    df['fecha_hora'] = pd.to_datetime(df['fecha'].astype(str) + ' ' + df['hora'].astype(str))
    # Eliminar fecha y hora anteriores
    df = drop_unnecessary_columns(df, ['fecha', 'hora'])
    return df

# Función que modifica el tipo de datos que tendrán las columnas
def change_column_types(df: pd.DataFrame) -> pd.DataFrame:
    """
    Cambia los tipos de datos de las columnas especificadas.
    
    Args:
        df: DataFrame original.
        
    Returns: 
        DataFrame con los tipos de datos de las columnas modificados.
    """
    df['gravedad'] = df['gravedad'].astype(str)
    df['peaton'] = df['peaton'].astype(int)
    df['automovil'] = df['automovil'].astype(int)
    df['campero'] = df['campero'].astype(int)
    df['camioneta'] = df['camioneta'].astype(int)
    df['micro'] = df['micro'].astype(int)
    df['buseta'] = df['buseta'].astype(int)
    df['bus'] = df['bus'].astype(int)
    df['camion'] = df['camion'].astype(int)
    df['volqueta'] = df['volqueta'].astype(int)
    df['moto'] = df['moto'].astype(int)
    df['bicicleta'] = df['bicicleta'].astype(int)
    df['otro'] = df['otro'].astype(int)
    df['via_1'] = df['via_1'].astype(str)
    df['barrio'] = df['barrio'].astype(str)
    df['entidad'] = df['entidad'].astype(str)
    df['nombrecomuna'] = df['nombrecomuna'].str.split('.').str[1].str.strip()
    df['propietario_vehiculo'] = df['propietario_vehiculo'].astype(str)
    df['diurnio_nocturno'] = df['diurnio_nocturno'].astype(str)
    df['hora_restriccion_moto'] = df['hora_restriccion_moto'].astype(str)
    return df

